class Random{static int(t,r){return Number.isInteger(t)&&Number.isInteger(r)?Math.floor(Math.random()*(r-t+1))+t:NaN}static float(t,r){return"number"!=typeof t||"number"!=typeof r?NaN:Math.random()*(r-t)+t}static choice(t){return t[Math.floor(Math.random()*t.length)]}static shuffle(t){if(Array.isArray(t)&&0!==t.length){for(let r=t.length-1;r>0;r--){const a=Math.floor(Math.random()*(r+1));[t[r],t[a]]=[t[a],t[r]]}return t}}}